enum SYMBOL_TYPE{
    SYMBOL_VALUE = 1,
    SYMBOL_ADD, 
    SYMBOL_SUB,
    SYMBOL_LT,
    SYMBOL_RT
};

const int STATE_NORMAL = 1;
const int STATE_READ_VALUE = 2;

struct Symbol{
    SYMBOL_TYPE type;
    int value;
};

void putValueSymbol(string valueStr , int &state , vector<Symbol> &symbols) {
    Symbol symbol;
    symbol.type = SYMBOL_VALUE;
    symbol.value = std::stoi(valueStr);
    symbols.push_back(symbol);

    state = STATE_NORMAL;
}

//将输入解析为符号表
int parseInputSymbols(string input , vector<Symbol> &symbols){
    const int len = input.length();
    const char *data = input.c_str();

    int index = 0;
    int state = STATE_NORMAL;

    string readStrContent;

    while(index < len){
        const char c = data[index];
        switch(c){
            case ' ':
                break;
            case '+':
                if(state == STATE_READ_VALUE){
                    putValueSymbol(readStrContent , state , symbols); 
                }
                
                if(state == STATE_NORMAL){
                    Symbol symbol;
                    symbol.type = SYMBOL_ADD;
                    symbol.value = '+';
                    symbols.push_back(symbol); 
                }
                break;
            case '-':
                if(state == STATE_READ_VALUE){
                    putValueSymbol(readStrContent , state , symbols);                  
                }

                if(state == STATE_NORMAL){
                    Symbol symbol;
                    symbol.type = SYMBOL_SUB;
                    symbol.value = '-';
                    symbols.push_back(symbol);
                }
                break;
            
            case '(':
                //state = STATE_NORMAL;
                if(state == STATE_READ_VALUE){
                    putValueSymbol(readStrContent , state , symbols);                  
                }

                if(state == STATE_NORMAL){
                    Symbol symbol;
                    symbol.type = SYMBOL_LT;
                    symbol.value = '(';
                    symbols.push_back(symbol);
                }
                break;
            case ')':
                if(state == STATE_READ_VALUE){
                    putValueSymbol(readStrContent , state , symbols);                  
                }

                if(state == STATE_NORMAL){
                    Symbol symbol;
                    symbol.type = SYMBOL_RT;
                    symbol.value = ')';
                    symbols.push_back(symbol);
                }
                break;
            case '0':
            case '1':
            case '2':
            case '3':
            case '4':
            case '5':
            case '6':
            case '7':
            case '8':
            case '9':
                if(state == STATE_NORMAL){
                    state = STATE_READ_VALUE;
                    readStrContent = string(1 , c);
                }else if(state == STATE_READ_VALUE){
                   readStrContent += string(1 , c);                     
                }
                break;
            default:
                if(state == STATE_NORMAL){
                    state = STATE_READ_VALUE;
                    readStrContent = string(1 , c);
                }else if(state == STATE_READ_VALUE){
                   readStrContent += string(1 , c);                     
                }
                break;
        }//end switch

        index++;
    }//end while

    if(state == STATE_READ_VALUE){
        putValueSymbol(readStrContent , state , symbols);
    }

    return 1;
}


Symbol calSymbol(int type , stack<Symbol> &helpStack){
    Symbol num2 = helpStack.top();
    helpStack.pop();
    int val2 = num2.value;

    Symbol num1 = helpStack.top();
    helpStack.pop();
    int val1 = num1.value;
    
    Symbol result;
    result.type = SYMBOL_VALUE;

    if(type == SYMBOL_ADD){
        //cout << val1 << " + " << val2 << " = " << (val1 + val2) << endl;
        result.value = val1 + val2;
    }else if(type == SYMBOL_SUB){
        //cout << val1 << " - " << val2 << " = " << (val1 - val2) << endl;
        result.value = val1 - val2;
    }
    
    return result;
}

//后缀表达式求值
int calculatePostfix(vector<Symbol *> postfixVec){
    stack<Symbol> helpStack;

    for(int i = 0 ; i < postfixVec.size();i++){
        Symbol *symbol = postfixVec[i];

        switch(symbol->type){
            case SYMBOL_ADD://相加
            case SYMBOL_SUB://减法
                helpStack.push(calSymbol(symbol->type , helpStack));
                break;
            default:
                Symbol s = *symbol;
                helpStack.push(s);
                break;
        }//end switch
    }//end for i

    if(!helpStack.empty()){
        return helpStack.top().value;
    }
    return 0;
}

//将符号表解析为后缀表达式
vector<Symbol *> parseToPostfix(vector<Symbol> &symbols) {
    vector<Symbol *> postfixResult;
    stack<Symbol *> helpStack;

    for(int i = 0 ; i < symbols.size();i++){
        Symbol &symbol = symbols[i];

        switch(symbol.type){
            case SYMBOL_ADD:// + - 运算符
            case SYMBOL_SUB:
                while(!helpStack.empty() && helpStack.top()->type != SYMBOL_LT){
                    postfixResult.push_back(helpStack.top());
                    helpStack.pop();
                }//end while

                helpStack.push(&symbol);
                break;
            case SYMBOL_LT: // (左边括号
                helpStack.push(&symbol);
                break;
            case SYMBOL_RT:
                while(!helpStack.empty() && helpStack.top()->type != SYMBOL_LT){
                    postfixResult.push_back(helpStack.top());
                    helpStack.pop();
                }

                if(helpStack.top()->type == SYMBOL_LT){
                    helpStack.pop();
                }
                break;
            case SYMBOL_VALUE:
                postfixResult.push_back(&symbol);
                break;
            default:
                break;
        }//end switch
    }//end for i

    while(!helpStack.empty()){
        postfixResult.push_back(helpStack.top());
        helpStack.pop();
    }//end while
    return postfixResult;
}

class Solution {
public:
    int calculate(string s) {
        //cout << s << endl;
        vector<Symbol> symbols;
        int r = parseInputSymbols(s , symbols);
        vector<Symbol *> postfixResult = parseToPostfix(symbols);

        // cout << "postfix : ";
        // for(int i = 0 ;i < postfixResult.size();i++){
        //     Symbol *p = postfixResult[i];
        //     cout << p->value << " ";
        // }
        // cout << endl;
        return calculatePostfix(postfixResult);
    }
};

